import './App.css';
import { BrowserRouter as Router } from "react-router-dom"
import LandingPage from './Components/LandingPage/LandingPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path ="/" element = {<LandingPage />}></Route>
      </Routes>
    </Router>
  );
}

export default App;
